Capturing the nervy, manic energy of Kentucky alt-rockers Cage the Elephant, Live from the Vic in Chicago gives fans an unfiltered version of their music with a blistering 19-song set. Recorded during a sold-out show at the famous Chicago venue, the album showcases the great back and forth that can happen during a live show, with the band and the crowd playing off one another to create a feedback loop of rock &amp; roll energy. While not a &quot;best-of&quot; album in the classic sense, this kind of spastic, sweat-fueled performance really shows Cage the Elephant at their best, making Live from the Vic in Chicago a live album that works well as both an introduction to the band and as a reminder to longtime fans of what makes this band so fun.
